import React from "react";
import {
  Nav,
  NavbarContainer,
  NavLogo,
  NavIcon,
  BtnSignin,
  BtnLogin,
  Buttons,
} from "./NavbarElement";
export const Navbar = () => {
  return (
    <Nav>
      <NavbarContainer>
        <NavLogo to="/">Kagu.</NavLogo>
      </NavbarContainer>
      <Buttons>
        <BtnSignin to="/Signin">Sign In</BtnSignin>
        <BtnLogin to="/Login">Log In</BtnLogin>
      </Buttons>
    </Nav>
  );
};
export default Navbar;
